import { $authHost, $host } from "./index";

export const fetchUslov = async (id) => {
    const {data} = await $host.get('api/uslov/'+ id)
    return data
}

export const changeUser = async(id, cost_arend, cost_el, cost_hesh) =>{
    const {data} = await $host.patch('api/uslov/'+ id, {})
    return data
}
